import React from 'react';
import { Link } from 'react-router-dom';

import yoga from '../../assets/icons/yoga.svg';
import './VerticalMenu.css';

const VerticalMenu = () => {
	return (
		<nav className="verticalMenu">
			<Link to="/yoga">
				<button>{yoga}</button>
			</Link>
		</nav>
	);
};

export default VerticalMenu;
